DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_DUPLICADO IS(
            SELECT 
                 ''||NUM_DOC||'-'||NUM_DOC_MENOR||'' AS NUM_DOC
                ,BAN_ESTADO_CARGUE
            FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1
            WHERE NVL(T1.BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%'
            AND (NOT REGEXP_LIKE(COD_DANE,'[[0-9]]') 
            OR NOT REGEXP_LIKE(COD_DANE_INS,'[[0-9]]') 
            OR NOT REGEXP_LIKE(COD_DANE_MENOR,'[[0-9]]')))
            ;

    v_Reg_Duplicados            CUR_DUPLICADO%ROWTYPE;
    v_Nro_Duplicados            PLS_Integer; 

BEGIN

   OPEN CUR_DUPLICADO;
   v_Nro_Duplicados := 0;

  LOOP
    FETCH CUR_DUPLICADO INTO v_Reg_Duplicados;
    EXIT WHEN CUR_DUPLICADO%NOTFOUND;
    BEGIN  
        IF v_Reg_Duplicados.NUM_DOC IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1
               SET BAN_ESTADO_CARGUE = 'E-'||'Para el Beneficiario '||v_Reg_Duplicados.NUM_DOC||' el DANE reportado no viene de la forma correcta, por favor revisar lo 3 codigos DANE de la data para identificar el error'
             WHERE ''||NUM_DOC||'-'||NUM_DOC_MENOR||'' = v_Reg_Duplicados.NUM_DOC;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_DUPLICADO;   

END;

DECLARE
err_msg VARCHAR2(255);
CURSOR CUR_DUPLICADO IS( SELECT NUM_DOC||'-'||NUM_IDENT_MENOR AS DUPLICADO FROM( SELECT TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) AS NUM_DOC ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') END) AS NUM_IDENT_MENOR ,BAN_ESTADO_CARGUE FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1 LEFT JOIN <?=odiRef.getObjectName("MINTIC_CATEG_BENEFI_DIM_TB_T1") ?> T2 ON (T1.CATEGORIA_BENF = T2.BENEFICIARIO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_ESTRATO_T1") ?> T3 ON (SUBSTR(T1.ESTRATO,INSTR(TRIM(T1.ESTRATO),'(',1)+1,INSTR(TRIM(T1.ESTRATO),')',1)-2) = T3.COD_ESTRATO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_TIP_IDENTIFICACION_T1") ?> T4 ON (SUBSTR(T1.TIP_DOC,INSTR(TRIM(T1.TIP_DOC),'(',1)+1,INSTR(TRIM(T1.TIP_DOC),')',1)-2) = T4.COD_TIP_IDENT) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_TIP_IDENTIFICACION_T1") ?> T5 ON (SUBSTR(T1.TIP_DOC_MENOR,INSTR(TRIM(T1.TIP_DOC_MENOR),'(',1)+1,INSTR(TRIM(T1.TIP_DOC_MENOR),')',1)-2) = T5.COD_TIP_IDENT) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T6 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE,INSTR(TRIM(T1.COD_DANE),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE,INSTR(TRIM(T1.COD_DANE),'[',1)+1)),']',1)-1),'0') = T6.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T7 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE_INS,INSTR(TRIM(T1.COD_DANE_INS),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE_INS,INSTR(TRIM(T1.COD_DANE_INS),'[',1)+1)),']',1)-1),'0') = T7.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T8 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE_MENOR,INSTR(TRIM(T1.COD_DANE_MENOR),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE_MENOR,INSTR(TRIM(T1.COD_DANE_MENOR),'[',1)+1)),']',1)-1),'0') = T8.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("MINTIC_ESTADO_LLMADA_DIM_TB_T1") ?> T9 ON (UPPER(TRIM(T1.ESTADO_LLAMADA)) = UPPER(TRIM(T9.DESC_ESTADO))) WHERE (T6.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T6.TIP_CENTRO_POBLADO = 'NO APLICA') AND (T7.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T7.TIP_CENTRO_POBLADO = 'NO APLICA') AND (T8.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T8.TIP_CENTRO_POBLADO = 'NO APLICA') AND NVL(T1.BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%') GROUP BY NUM_DOC||'-'||NUM_IDENT_MENOR HAVING COUNT(NUM_DOC||'-'||NUM_IDENT_MENOR) > 1);
v_Reg_Duplicados CUR_DUPLICADO%ROWTYPE; v_Nro_Duplicados PLS_Integer;
BEGIN
OPEN CUR_DUPLICADO; v_Nro_Duplicados := 0;
LOOP FETCH CUR_DUPLICADO INTO v_Reg_Duplicados; EXIT WHEN CUR_DUPLICADO%NOTFOUND; BEGIN IF v_Reg_Duplicados.DUPLICADO IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1 SET BAN_ESTADO_CARGUE = 'E-'||'Los numeros de documento de los beneficiarios "'||v_Reg_Duplicados.DUPLICADO||'" vienen duplicados' WHERE TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END)||'-'||TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') END) = v_Reg_Duplicados.DUPLICADO; END IF; END; END LOOP; CLOSE CUR_DUPLICADO;
END;

