err_msg VARCHAR2(255);
CURSOR CUR_DUPLICADO IS( SELECT NUM_DOC ,NUM_IDENT_MENOR ,BAN_ESTADO_CARGUE ,TRIM(MAX(CASE WHEN UPPER(CATEGORIA_BENF) LIKE UPPER('%MUJERES%EMPRENDEDORAS%') AND SK_CATEG_BENEF = -1 AND SK_MUNICIPIO = -1 THEN 'E-El codigo dane del beneficiario viene sin corchetes [], el codigo dane no existente o el campo viene vacio.'||'|' END)|| MAX(CASE WHEN UPPER(CATEGORIA_BENF) LIKE UPPER('%ESTUDIANTES%MENORES%DE%EDAD%') AND SK_CATEG_BENEF = -1 AND (SK_MUNICIPIO = -1 OR SK_MUNICIPIO_M = -1 OR SK_MUNICIPIO_INS = -1) THEN 'E-El codigo dane (De alguno de los 3 solicitados) viene sin corchetes [], el codigo dane no existente o el campo viene vacio.'||'|' END)|| MAX(CASE WHEN UPPER(CATEGORIA_BENF) LIKE UPPER('%ESTUDIANTES%MAYORES%DE%EDAD%') AND SK_CATEG_BENEF = -1 AND (SK_MUNICIPIO = -1 OR SK_MUNICIPIO_INS = -1) THEN 'E-El codigo dane del benefiario o la institucion viene sin corchetes [], el codigo dane no existente o el campo viene vacio.'||'|' END)|| MAX(CASE WHEN SK_CATEG_BENEF = -1 THEN 'E-La categoria asignada del benefiairio '||CATEGORIA_BENF||' no cumple con lo que se espera. ' END)) AS ERRORES FROM( SELECT TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) AS NUM_DOC ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') END) AS NUM_IDENT_MENOR ,BAN_ESTADO_CARGUE ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T8.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T6.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T6.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T8.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO_M ,TRIM(NVL(T7.SK_MUNICIPIO,-1)) AS SK_MUNICIPIO_INS ,TRIM(NVL(T2.SK_CATEG_BENEF,-1)) AS SK_CATEG_BENEF ,T1.CATEGORIA_BENF FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1 LEFT JOIN <?=odiRef.getObjectName("MINTIC_CATEG_BENEFI_DIM_TB_T1") ?> T2 ON (T1.CATEGORIA_BENF = T2.BENEFICIARIO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_ESTRATO_T1") ?> T3 ON (SUBSTR(T1.ESTRATO,INSTR(TRIM(T1.ESTRATO),'(',1)+1,INSTR(TRIM(T1.ESTRATO),')',1)-2) = T3.COD_ESTRATO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_TIP_IDENTIFICACION_T1") ?> T4 ON (SUBSTR(T1.TIP_DOC,INSTR(TRIM(T1.TIP_DOC),'(',1)+1,INSTR(TRIM(T1.TIP_DOC),')',1)-2) = T4.COD_TIP_IDENT) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_TIP_IDENTIFICACION_T1") ?> T5 ON (SUBSTR(T1.TIP_DOC_MENOR,INSTR(TRIM(T1.TIP_DOC_MENOR),'(',1)+1,INSTR(TRIM(T1.TIP_DOC_MENOR),')',1)-2) = T5.COD_TIP_IDENT) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T6 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE,INSTR(TRIM(T1.COD_DANE),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE,INSTR(TRIM(T1.COD_DANE),'[',1)+1)),']',1)-1),'0') = T6.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T7 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE_INS,INSTR(TRIM(T1.COD_DANE_INS),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE_INS,INSTR(TRIM(T1.COD_DANE_INS),'[',1)+1)),']',1)-1),'0') = T7.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T8 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE_MENOR,INSTR(TRIM(T1.COD_DANE_MENOR),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE_MENOR,INSTR(TRIM(T1.COD_DANE_MENOR),'[',1)+1)),']',1)-1),'0') = T8.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("MINTIC_ESTADO_LLMADA_DIM_TB_T1") ?> T9 ON (UPPER(TRIM(T1.ESTADO_LLAMADA)) = UPPER(TRIM(T9.DESC_ESTADO))) WHERE (T6.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T6.TIP_CENTRO_POBLADO = 'NO APLICA') AND (T7.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T7.TIP_CENTRO_POBLADO = 'NO APLICA') AND (T8.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T8.TIP_CENTRO_POBLADO = 'NO APLICA') GROUP BY TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') END) ,BAN_ESTADO_CARGUE ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T8.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T6.SK_MUNICIPIO,-1)) END) ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T6.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T8.SK_MUNICIPIO,-1)) END) ,TRIM(NVL(T7.SK_MUNICIPIO,-1)) ,TRIM(NVL(T2.SK_CATEG_BENEF,-1)) ,T1.CATEGORIA_BENF ) UM1 WHERE NVL(UM1.BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%' GROUP BY NUM_DOC ,NUM_IDENT_MENOR ,BAN_ESTADO_CARGUE );
