BEGIN
OPEN CUR_DUPLICADO; v_Nro_Duplicados := 0;
LOOP FETCH CUR_DUPLICADO INTO v_Reg_Duplicados; EXIT WHEN CUR_DUPLICADO%NOTFOUND; BEGIN IF v_Reg_Duplicados.ERRORES IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1 SET BAN_ESTADO_CARGUE = v_Reg_Duplicados.ERRORES WHERE TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END)||'-'||TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') END) = v_Reg_Duplicados.NUM_DOC||'-'||v_Reg_Duplicados.NUM_IDENT_MENOR; END IF; END; END LOOP; CLOSE CUR_DUPLICADO;
