DECLARE
err_msg VARCHAR2(255);
CURSOR CUR_DUPLICADO IS( SELECT T1.* ,''||T2.NOM_DEPARTAMENTO||'-'||T2.NOM_MUNICIPIO||'' AS DEPAR_MUNIC FROM( SELECT TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) AS NUM_DOC_MILLA ,T3.SK_MUNICIPIO AS SK_MUNI_ETAPA ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T6.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T6.SK_MUNICIPIO,-1)) END) AS SK_MUNI_MILLA ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') END) AS NUM_DOC_MENOR ,BAN_ESTADO_CARGUE FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1 LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T6 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE,INSTR(TRIM(T1.COD_DANE),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE,INSTR(TRIM(T1.COD_DANE),'[',1)+1)),']',1)-1),'0') = T6.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T8 ON (NVL(SUBSTR(SUBSTR(T1.COD_DANE_MENOR,INSTR(TRIM(T1.COD_DANE_MENOR),'[',1)+1),1,INSTR(TRIM(SUBSTR(T1.COD_DANE_MENOR,INSTR(TRIM(T1.COD_DANE_MENOR),'[',1)+1)),']',1)-1),'0') = T8.COD_MUNICIPIO) LEFT JOIN <?=odiRef.getObjectName("MINTIC_ESTADO_LLMADA_DIM_TB_T1") ?> T9 ON (UPPER(TRIM(T1.ESTADO_LLAMADA)) = UPPER(TRIM(T9.DESC_ESTADO))) LEFT JOIN <?=odiRef.getObjectName("MINTIC_ESTADO_ETAPA_DIM_TB_T1") ?> T3 ON (TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T6.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T6.SK_MUNICIPIO,-1)) END) = T3.SK_MUNICIPIO) WHERE (T6.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T6.TIP_CENTRO_POBLADO = 'NO APLICA') AND (T8.TIP_CENTRO_POBLADO = 'CABECERA MUNICIPAL (CM)' OR T8.TIP_CENTRO_POBLADO = 'NO APLICA') AND TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) IS NOT NULL AND T3.SK_MUNICIPIO IS NULL) T1 JOIN <?=odiRef.getObjectName("TBL_DIM_MUNICIPIOS_DANE_T1") ?> T2 ON (T1.SK_MUNI_MILLA = T2.SK_MUNICIPIO) WHERE NVL(T1.BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%') ;
v_Reg_Duplicados CUR_DUPLICADO%ROWTYPE; v_Nro_Duplicados PLS_Integer;
BEGIN
OPEN CUR_DUPLICADO; v_Nro_Duplicados := 0;
LOOP FETCH CUR_DUPLICADO INTO v_Reg_Duplicados; EXIT WHEN CUR_DUPLICADO%NOTFOUND; BEGIN IF v_Reg_Duplicados.NUM_DOC_MILLA IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1 SET BAN_ESTADO_CARGUE = 'E-'||'Para el Beneficiario '||v_Reg_Duplicados.NUM_DOC_MENOR||' el DANE reportado '||v_Reg_Duplicados.DEPAR_MUNIC||' no pertence a los Departamento/Municipio del proyecto "' WHERE TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) = v_Reg_Duplicados.NUM_DOC_MILLA; END IF; END; END LOOP; CLOSE CUR_DUPLICADO;
END;

DECLARE

err_msg    VARCHAR2(255);

CURSOR CUR_ERRORES IS(
        SELECT
            *
        FROM(
            SELECT
                CASE
                   WHEN T2.SK_CATEG_BENEF = 1 AND NVL(T4.SK_TIP_IDENT,-1) = 4 AND (NVL(T3.SK_TIP_IDENT,-1) = 1 OR NVL(T3.SK_TIP_IDENT,-1) = 6) THEN NULL
                   WHEN T2.SK_CATEG_BENEF = 2 AND NVL(T3.SK_TIP_IDENT,-1) = 4 AND NVL(T4.SK_TIP_IDENT,-1) = -1 THEN NULL
                   WHEN T2.SK_CATEG_BENEF = 3 AND NVL(T3.SK_TIP_IDENT,-1) = 4 AND NVL(T4.SK_TIP_IDENT,-1) = -1 THEN NULL
                   ELSE 'E-los tipos de documento no coresponde a la categoria del beneficiario: '||T1.CATEGORIA_BENF END AS ERRORES
                ,NUM_DOC
                ,TIP_DOC
                ,BAN_ESTADO_CARGUE
            FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1
            LEFT JOIN <?=odiRef.getObjectName("MINTIC_CATEG_BENEFI_DIM_TB_T1") ?> T2
            ON (T1.CATEGORIA_BENF = T2.BENEFICIARIO)
            LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_TIP_IDENTIFICACION_T1") ?> T3
            ON (SUBSTR(T1.TIP_DOC,INSTR(TRIM(T1.TIP_DOC),'(',1)+1,INSTR(TRIM(T1.TIP_DOC),')',1)-2) = T3.COD_TIP_IDENT)
            LEFT JOIN <?=odiRef.getObjectName("TBL_DIM_TIP_IDENTIFICACION_T1") ?> T4
            ON (SUBSTR(T1.TIP_DOC_MENOR,INSTR(TRIM(T1.TIP_DOC_MENOR),'(',1)+1,INSTR(TRIM(T1.TIP_DOC_MENOR),')',1)-2) = T4.COD_TIP_IDENT)) T1
                WHERE NVL(T1.BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%'
                AND T1.ERRORES IS NOT NULL

                );

    v_Reg_Errores            CUR_ERRORES%ROWTYPE;
    v_Nro_Errores            PLS_Integer; 

BEGIN

   OPEN CUR_ERRORES;
   v_Nro_Errores := 0;

  LOOP
    FETCH CUR_ERRORES INTO v_Reg_Errores;
    EXIT WHEN CUR_ERRORES%NOTFOUND;
    BEGIN  
        IF v_Reg_Errores.ERRORES IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1
                   SET BAN_ESTADO_CARGUE = v_Reg_Errores.ERRORES
             WHERE T1.NUM_DOC = v_Reg_Errores.NUM_DOC
             --AND NUM_IDENT_MENOR = v_Reg_Errores.NUM_IDENT_MENOR;
             ;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_ERRORES;   

END;

DECLARE err_msg VARCHAR2(255);
CURSOR CUR_ULTIMA_MILLA IS SELECT * FROM(SELECT TRIM(NVL(T2.SK_CATEG_BENEF,-1)) AS SK_CATEG_BENEF ,TRIM(NVL(T3.SK_ESTRATO,-1)) AS SK_ESTRATO ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T5.SK_TIP_IDENT,-1)) ELSE TRIM(NVL(T4.SK_TIP_IDENT,-1)) END) AS SK_TIP_IDENT ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T4.SK_TIP_IDENT,-1)) ELSE TRIM(NVL(T5.SK_TIP_IDENT,-1)) END) AS SK_TIP_IDENT_M ,-1 AS SK_TECNOLOGIA -- SK_TECNOLOGIA VA EN -1 POR AHORA ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T8.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T6.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T6.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T8.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO_M ,TRIM(NVL(T7.SK_MUNICIPIO,-1)) AS SK_MUNICIPIO_INS ,-1 AS SK_ETAPA -- SK_ETAPA VA EN -1 POR AHORA ,-1 AS MIN -- MIN va null todavia no se tien min que asociar ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.PRIMER_NOM_MENOR ELSE T1.PRIMER_NOM END) AS PRIMER_NOM ,NVL(TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.SEG_NOM_MENOR ELSE T1.SEG_NOM END),'-') AS SEG_NOM ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.PRIMER_APELL_MENOR ELSE T1.PRIMER_APELL END) AS PRIMER_APELL ,NVL(TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.SEG_APELLI_MENOR ELSE T1.SEG_APELL END),'-') AS SEG_APELL ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) AS NUM_DOC ,NVL(CASE WHEN T1.FEC_NACIMIENTO = '00/01/1900' THEN '01/01/1900' ELSE T1.FEC_NACIMIENTO END, '01/01/1900') AS FEC_NACIMIENTO ,NVL(CASE WHEN T1.FEC_EXPEDICION = '