LEFT JOIN ( SELECT NUM_DOC AS NUM_DOC_LEFT ,NUM_IDENT_MENOR AS NUM_IDENT_MENOR_L ,CASE WHEN SK_CATEG_BENEF = 1 THEN NUM_IDENT_MENOR ELSE NUM_DOC END AS CASTEO_NUM_DOC FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?>) UM2 ON (UM2.NUM_DOC_LEFT = UM1.NUM_IDENT_MENOR) --ON (UM2.CASTEO_NUM_DOC = CASE WHEN UM1.SK_CATEG_BENEF = 1 THEN UM1.NUM_IDENT_MENOR ELSE UM1.NUM_DOC END) WHERE NVL(BAN_ESTADO_CARGUE,'0')NOT LIKE '%E%' AND UM1.SERVICIO_VOZ_DATOS = 'MENOR';
v_Reg_Ultima_Milla CUR_ULTIMA_MILLA%ROWTYPE; v_Nro_Registros PLS_Integer;
BEGIN OPEN CUR_ULTIMA_MILLA; v_Nro_Registros := 0; LOOP FETCH CUR_ULTIMA_MILLA INTO v_Reg_Ultima_Milla; --DBMS_OUTPUT.PUT_LINE('v_Reg_Ultima_Milla'||v_Reg_Ultima_Milla.NUM_DOC_1); EXIT WHEN CUR_ULTIMA_MILLA%NOTFOUND;
BEGIN IF v_Reg_Ultima_Milla.NUM_DOC_LEFT IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> A SET SK_CATEG_BENEF = v_Reg_Ultima_Milla.SK_CATEG_BENEF ,SK_ESTRATO = v_Reg_Ultima_Milla. SK_ESTRATO ,SK_TIP_IDENT = v_Reg_Ultima_Milla.SK_TIP_IDENT ,SK_TIP_IDENT_M = v_Reg_Ultima_Milla.SK_TIP_IDENT_M ,SK_TECNOLOGIA = v_Reg_Ultima_Milla.SK_TECNOLOGIA ,SK_MUNICIPIO = v_Reg_Ultima_Milla.SK_MUNICIPIO ,SK_MUNICIPIO_M = v_Reg_Ultima_Milla.SK_MUNICIPIO_M ,SK_MUNICIPIO_INS = v_Reg_Ultima_Milla.SK_MUNICIPIO_INS ,SK_ETAPA = v_Reg_Ultima_Milla.SK_ETAPA ,PRIMER_NOM = v_Reg_Ultima_Milla.PRIMER_NOM ,SEG_NOM = v_Reg_Ultima_Milla.SEG_NOM ,PRIMER_APELL = v_Reg_Ultima_Milla.PRIMER_APELL ,SEG_APELL = v_Reg_Ultima_Milla.SEG_APELL ,NUM_DOC = v_Reg_Ultima_Milla.NUM_DOC ,FEC_NACIMIENTO = v_Reg_Ultima_Milla.FEC_NACIMIENTO ,FEC_EXPEDICION = v_Reg_Ultima_Milla.FEC_EXPEDICION ,EMAIL = v_Reg_Ultima_Milla.EMAIL ,TELEFONO1 = v_Reg_Ultima_Milla.TELENUM1 ,TELEFONO2 = v_Reg_Ultima_Milla.TELENUM2 ,TELEFONO3 = v_Reg_Ultima_Milla.TELENUM3 ,DIRECCION = v_Reg_Ultima_Milla.DIRECCION ,BARRIO_VEREDA = v_Reg_Ultima_Milla.BARRIO ,TIENE_SERVICIO = v_Reg_Ultima_Milla.TIENE_SERVICIO ,EQUIPO_4G = v_Reg_Ultima_Milla.EQUIPO_4G ,PAGO_SIMCARD = v_Reg_Ultima_Milla.PAGO_SIMCARD ,CONFIRMA_PAGO = v_Reg_Ultima_Milla.CONFIRMA_PAGO ,NOM_INSTITUCION = v_Reg_Ultima_Milla.NOM_INSTITUCION ,DIREC_INSTITUCION = v_Reg_Ultima_Milla.DIREC_INSTITUCION ,GRADO_SEMES_CURSO = v_Reg_Ultima_Milla.GRADO_SEMES_CURSO ,MESES_FINAL_ESTUDIO = v_Reg_Ultima_Milla.MESES_FINAL_ESTUDIO ,PRIMER_NOM_MENOR = v_Reg_Ultima_Milla.PRIMER_NOM_MENOR ,SEG_NOM_MENOR = v_Reg_Ultima_Milla.SEG_NOM_MENOR ,PRIMER_APELL_MENOR = v_Reg_Ultima_Milla.PRIMER_APELL_MENOR ,SEG_APELLI_MENOR = v_Reg_Ultima_Milla.SEG_APELLI_MENOR ,NUM_IDENT_MENOR = v_Reg_Ultima_Milla.NUM_IDENT_MENOR ,PARENTESCO_MENOR = v_Reg_Ultima_Milla.PARENTESCO_MENOR ,DIRECCION_MENOR = v_Reg_Ultima_Milla.DIRECCION_MENOR ,BARRIO_VEREDA_MENOR = v_Reg_Ultima_Milla.BARRIO_MENOR ,PROGR