UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E- Se pasa el beneficiario '||v_Reg_Ultima_Milla.NUM_IDENT_MENOR||' de mayor de edad a menor de edad' --'E-se actuliza registro segun solictud de cambia a '||v_Reg_Ultima_Milla.SERVICIO_VOZ_DATOS||'' WHERE A.NUM_DOC = v_Reg_Ultima_Milla.NUM_IDENT_MENOR;
COMMIT; ELSE UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E- No se cumple la condicion para actulizar el beneficieio '||v_Reg_Ultima_Milla.NUM_IDENT_MENOR||' de mayor de edad a menor de edad' WHERE BAN_ESTADO_CARGUE IS NULL AND SERVICIO_VOZ_DATOS = 'MENOR'; COMMIT; END IF;
v_Nro_Registros := v_Nro_Registros + 1;
IF MOD (v_Nro_Registros, 5000) = 0 THEN COMMIT; END IF;
EXCEPTION WHEN OTHERS THEN err_msg := SQLERRM; UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||err_msg WHERE A.NUM_DOC = v_Reg_Ultima_Milla.NUM_IDENT_MENOR;
END; END LOOP; COMMIT; CLOSE CUR_ULTIMA_MILLA;
END;

DECLARE err_msg VARCHAR2(255);
CURSOR CUR_ULTIMA_MILLA IS SELECT * FROM(SELECT TRIM(NVL(T2.SK_CATEG_BENEF,-1)) AS SK_CATEG_BENEF ,TRIM(NVL(T3.SK_ESTRATO,-1)) AS SK_ESTRATO ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T5.SK_TIP_IDENT,-1)) ELSE TRIM(NVL(T4.SK_TIP_IDENT,-1)) END) AS SK_TIP_IDENT ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T4.SK_TIP_IDENT,-1)) ELSE TRIM(NVL(T5.SK_TIP_IDENT,-1)) END) AS SK_TIP_IDENT_M ,-1 AS SK_TECNOLOGIA -- SK_TECNOLOGIA VA EN -1 POR AHORA ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T8.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T6.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T6.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T8.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO_M ,TRIM(NVL(T7.SK_MUNICIPIO,-1)) AS SK_MUNICIPIO_INS ,-1 AS SK_ETAPA -- SK_ETAPA VA EN -1 POR AHORA ,NULL AS MIN -- MIN va null todavia no se tien min que asociar ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.PRIMER_NOM_MENOR ELSE T1.PRIMER_NOM END) AS PRIMER_NOM ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.SEG_NOM_MENOR ELSE T1.SEG_NOM END) AS SEG_NOM ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.PRIMER_APELL_MENOR ELSE T1.PRIMER_APELL END) AS PRIMER_APELL ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.SEG_APELLI_MENOR ELSE T1.SEG_APELL END) AS SEG_APELL ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) AS NUM_DOC ,CASE WHEN T1.FEC_NACIMIENTO = '00/01/1900' THEN '01/01/1900' ELSE T1.FEC_NACIMIENTO END AS FEC_NACIMIENTO ,CASE WHEN T1.FEC_EXPEDICION = '00/01/1900' THEN '01/01/1900' ELSE T1.F