v_Reg_Ultima_Milla CUR_ULTIMA_MILLA%ROWTYPE; v_Nro_Registros PLS_Integer;
BEGIN OPEN CUR_ULTIMA_MILLA; v_Nro_Registros := 0; LOOP FETCH CUR_ULTIMA_MILLA INTO v_Reg_Ultima_Milla; --DBMS_OUTPUT.PUT_LINE('v_Reg_Ultima_Milla'||v_Reg_Ultima_Milla.NUM_DOC_1); EXIT WHEN CUR_ULTIMA_MILLA%NOTFOUND;
BEGIN IF v_Reg_Ultima_Milla.NUM_DOC_LEFT IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> A SET NUM_DOC = v_Reg_Ultima_Milla.NUM_DOC WHERE CASE WHEN A.SK_CATEG_BENEF = 1 THEN A.NUM_IDENT_MENOR ELSE A.NUM_DOC END = v_Reg_Ultima_Milla.NUM_CAMBIO ;
UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E- Se cambia el numero de documento del acudiente ('||v_Reg_Ultima_Milla.NUM_DOC_LEFT||') por el nuevo numero '||v_Reg_Ultima_Milla.NUM_DOC||'' --'E-se actuliza registro segun solictud de cambia a '||v_Reg_Ultima_Milla.SERVICIO_VOZ_DATOS||'' WHERE A.NUM_DOC_MENOR = v_Reg_Ultima_Milla.NUM_DOC;
COMMIT; ELSE UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E- No cumple la condicion para actulizar el beneficiario '||v_Reg_Ultima_Milla.NUM_DOC_LEFT||' con la condicion de '||v_Reg_Ultima_Milla.SERVICIO_VOZ_DATOS||'' WHERE a.SERVICIO_VOZ_DATOS = 'ACUDIENTE' AND A.NUM_DOC_MENOR = v_Reg_Ultima_Milla.NUM_DOC; COMMIT; END IF;
v_Nro_Registros := v_Nro_Registros + 1;
IF MOD (v_Nro_Registros, 5000) = 0 THEN COMMIT; END IF;
EXCEPTION WHEN OTHERS THEN err_msg := SQLERRM; UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||err_msg WHERE A.NUM_DOC_MENOR = v_Reg_Ultima_Milla.NUM_DOC;
END; END LOOP; COMMIT; CLOSE CUR_ULTIMA_MILLA;
END;

DECLARE err_msg VARCHAR2(255);
CURSOR CUR_ULTIMA_MILLA IS SELECT * FROM(SELECT TRIM(NVL(T2.SK_CATEG_BENEF,-1)) AS SK_CATEG_BENEF ,TRIM(NVL(T3.SK_ESTRATO,-1)) AS SK_ESTRATO ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T5.SK_TIP_IDENT,-1)) ELSE TRIM(NVL(T4.SK_TIP_IDENT,-1)) END) AS SK_TIP_IDENT ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T4.SK_TIP_IDENT,-1)) ELSE TRIM(NVL(T5.SK_TIP_IDENT,-1)) END) AS SK_TIP_IDENT_M ,-1 AS SK_TECNOLOGIA -- SK_TECNOLOGIA VA EN -1 POR AHORA ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T8.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T6.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN TRIM(NVL(T6.SK_MUNICIPIO,-1)) ELSE TRIM(NVL(T8.SK_MUNICIPIO,-1)) END) AS SK_MUNICIPIO_M ,TRIM(NVL(T7.SK_MUNICIPIO,-1)) AS SK_MUNICIPIO_INS ,-1 AS SK_ETAPA -- SK_ETAPA VA EN -1 POR AHORA ,-1 AS MIN -- MIN va null todavia no se tien min que asociar ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.PRIMER_NOM_MENOR ELSE T1.PRIMER_NOM END) AS PRIMER_NOM ,NVL(TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.SEG_NOM_MENOR ELSE T1.SEG_NOM END),'-') AS SEG_NOM ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.PRIMER_APELL_MENOR ELSE T1.PRIMER_APELL END) AS PRIMER_APELL ,NVL(TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN T1.SEG_APELLI_MENOR ELSE T1.SEG_APELL END),'-') AS SEG_APELL ,TRIM(CASE WHEN UPPER(T1.CATEGORIA_BENF) = UPPER('Estudiantes menores de edad') THEN REGEXP_REPLACE(TRIM(T1.NUM_DOC_MENOR), '[^0-9]+', '') ELSE REGEXP_REPLACE(TRIM(T1.NUM_DOC), '[^0-9]+', '') END) AS NUM_DOC ,NVL(CASE WHEN T1.FEC_NACIMIENTO = '00/01/1900' THEN '01/01/1900' ELSE T1.FEC_NACIMIENTO END, '01/01/1900') AS FEC_NACIMIENTO ,NVL(CASE WHEN T1.FEC_EXPEDICION = '00/01/1900' THEN '01/01/1900' ELSE T1.FEC_EXPEDICION END,'01/01/1900') AS FEC_EXPEDICION ,NVL(TRIM(CASE WHEN UPPER(TRIM(T1.CATEGORIA_BENF)) = UPPER('Estudiantes menores de edad') THEN TRIM(T1.EMAIL_MENOR) ELSE TRIM(T1.EMAIL) END),'NOTIENECORREO@GMAIL.COM') AS EMAIL ,NVL(CASE WHEN REGEXP_REPLACE(TRIM(T1.TELENUM1), '[^0-9]+', '') LIKE '57%' THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM1), '[^0-9]+', ''),3,10) WHEN REGEXP_REPLACE(TRIM(T1.TELENUM1), '[^0-9]+', '') LIKE '3%' THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM1), '[^0-9]+', ''),1,10) WHEN LENGTH(REGEXP_REPLACE(TRIM(T1.TELENUM1), '[^0-9]+', '')) > 10 THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM1), '[^0-9]+', ''),-10) ELSE SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM1), '[^0-9]+', ''),1,10) END,-1) AS TELENUM1 ,NVL(CASE WHEN REGEXP_REPLACE(TRIM(T1.TELENUM2), '[^0-9]+', '') LIKE '57%' THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM2), '[^0-9]+', ''),3,10) WHEN REGEXP_REPLACE(TRIM(T1.TELENUM2), '[^0-9]+', '') LIKE '3%' THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM2), '[^0-9]+', ''),1,10) WHEN LENGTH(REGEXP_REPLACE(TRIM(T1.TELENUM2), '[^0-9]+', '')) > 10 THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM2), '[^0-9]+', ''),-10) ELSE SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM2), '[^0-9]+', ''),1,10) END,-1) AS TELENUM2 ,NVL(CASE WHEN REGEXP_REPLACE(TRIM(T1.TELENUM3), '[^0-9]+', '') LIKE '57%' THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM3), '[^0-9]+', ''),3,10) WHEN REGEXP_REPLACE(TRIM(T1.TELENUM3), '[^0-9]+', '') LIKE '3%' THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM3), '[^0-9]+', ''),1,10) WHEN LENGTH(REGEXP_REPLACE(TRIM(T1.TELENUM3), '[^0-9]+', '')) > 10 THEN SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM3), '[^0-9]+', ''),-10) ELSE SUBSTR(REGEXP_REPLACE(TRIM(T1.TELENUM3), '[^0-9]+', ''),1,10) END,-1) AS TELENUM3 ,NVL(CASE WHEN UPPER(TRIM(T1.CATEGORIA_BENF)) = UPPER('Estudiantes menores de edad') THEN TRIM(T1.DIR_MENOR) ELSE TRIM(T1.DIRECCION) END,'-') AS DIRECCION ,NVL(CASE WHEN UPPER(TRIM(T1.CATEGORIA_BENF)) = UPPER('Estudiantes menores de edad') THEN TRIM(T1.BA