v_Reg_Ultima_Milla CUR_ULTIMA_MILLA%ROWTYPE; v_Nro_Registros PLS_Integer;
BEGIN OPEN CUR_ULTIMA_MILLA; v_Nro_Registros := 0; LOOP FETCH CUR_ULTIMA_MILLA INTO v_Reg_Ultima_Milla; --DBMS_OUTPUT.PUT_LINE('v_Reg_Ultima_Milla'||v_Reg_Ultima_Milla.NUM_DOC_1); EXIT WHEN CUR_ULTIMA_MILLA%NOTFOUND;
BEGIN IF v_Reg_Ultima_Milla.CASTEO_NUM_DOC IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> A SET A.NUM_DOC = CASE WHEN v_Reg_Ultima_Milla.CASTEO_NUM_DOC = v_Reg_Ultima_Milla.NUM_DOC_LEFT THEN (CASE WHEN v_Reg_Ultima_Milla.SK_CATEG_BENEF IN (2,3) THEN v_Reg_Ultima_Milla.NUM_IDENT_MENOR_L ELSE v_Reg_Ultima_Milla.NUM_DOC_LEFT END) END ,A.NUM_IDENT_MENOR = CASE WHEN v_Reg_Ultima_Milla.CASTEO_NUM_DOC = v_Reg_Ultima_Milla.NUM_DOC_LEFT THEN '-1 ' ELSE (CASE WHEN v_Reg_Ultima_Milla.SK_CATEG_BENEF = 1 THEN v_Reg_Ultima_Milla.NUM_IDENT_MENOR_L ELSE v_Reg_Ultima_Milla.NUM_DOC_LEFT END) END WHERE CASE WHEN A.SK_CATEG_BENEF = 1 THEN A.NUM_IDENT_MENOR ELSE A.NUM_DOC END = v_Reg_Ultima_Milla.NUM_CAMBIO ;
UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E- Se cambia el numero de documento del acudiente ('||v_Reg_Ultima_Milla.NUM_DOC_LEFT||') por el nuevo numero '||v_Reg_Ultima_Milla.NUM_DOC||'' --'E-se actuliza registro segun solictud de cambia a '||v_Reg_Ultima_Milla.SERVICIO_VOZ_DATOS||'' WHERE SUBSTR(REPLACE(A.SERVICIO_VOZ_DATOS,' ',''),INSTR(REPLACE(A.SERVICIO_VOZ_DATOS,' ',''),'-',1)+1) = v_Reg_Ultima_Milla.NUM_CAMBIO;
COMMIT; ELSE UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E- No cumple la condicion para actulizar el beneficiario '||v_Reg_Ultima_Milla.NUM_DOC_LEFT||' con la condicion de '||v_Reg_Ultima_Milla.SERVICIO_VOZ_DATOS||'' WHERE a.SERVICIO_VOZ_DATOS = 'CORREGIR' AND SUBSTR(REPLACE(A.SERVICIO_VOZ_DATOS,' ',''),INSTR(REPLACE(A.SERVICIO_VOZ_DATOS,' ',''),'-',1)+1) = v_Reg_Ultima_Milla.NUM_CAMBIO; COMMIT; END IF;
v_Nro_Registros := v_Nro_Registros + 1;
IF MOD (v_Nro_Registros, 5000) = 0 THEN COMMIT; END IF;
EXCEPTION WHEN OTHERS THEN err_msg := SQLERRM; UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||err_msg WHERE A.NUM_DOC_MENOR = v_Reg_Ultima_Milla.NUM_DOC;
END; END LOOP; UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> SET SERVICIO_VOZ_DATOS = 'N/A' WHERE (SERVICIO_VOZ_DATOS NOT LIKE '%MENOR%' OR SERVICIO_VOZ_DATOS NOT LIKE '%ACUDIENTE%' OR SERVICIO_VOZ_DATOS NOT LIKE '%CORREGIR%' OR SERVICIO_VOZ_DATOS NOT LIKE '%MAYOR%'); COMMIT; CLOSE CUR_ULTIMA_MILLA;
