DECLARE
V_TOTAL NUMBER := 10; BANDERA NUMBER := 1;
BEGIN WHILE BANDERA = 1 LOOP --dbms_output.put_line('VALOR : ' ||BANDERA); IF V_TOTAL > 1 THEN
MERGE INTO <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T1 USING (WITH QUERY1 AS( SELECT MAX(T1.ROWID) MAX_ROWID ,T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR AS NUM_DOC_P ,COUNT(*) AS TOTAL FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T1 JOIN (SELECT NUM_DOC||'-'||NUM_IDENT_MENOR AS NUM_DOC_P FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> WHERE BAN_ESTADO_REG = 1 GROUP BY NUM_DOC||'-'||NUM_IDENT_MENOR HAVING COUNT(NUM_DOC||'-'||NUM_IDENT_MENOR) > 1) T2 ON (T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR = T2.NUM_DOC_P) WHERE BAN_ESTADO_REG = 1 GROUP BY T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR ), QUERY2 AS ( SELECT T1.ROWID ,T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR AS NUM_DOC_P FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T1 WHERE BAN_ESTADO_REG = 1 ) SELECT QUERY1.MAX_ROWID ,QUERY2.NUM_DOC_P ,QUERY1.TOTAL FROM QUERY1 QUERY1 JOIN QUERY2 QUERY2 ON (QUERY1.MAX_ROWID = QUERY2.ROWID AND QUERY1.NUM_DOC_P = QUERY2.NUM_DOC_P)) T2 ON (T1.ROWID = T2.MAX_ROWID AND T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR = T2.NUM_DOC_P) WHEN MATCHED THEN UPDATE SET T1.BAN_ESTADO_REG = 2;
SELECT TOTAL INTO V_TOTAL FROM ( SELECT NVL(MAX(COUNT(1)),0) AS TOTAL FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T1 JOIN (SELECT NUM_DOC||'-'||NUM_IDENT_MENOR AS NUM_DOC_P FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> WHERE BAN_ESTADO_REG = 1 GROUP BY NUM_DOC||'-'||NUM_IDENT_MENOR HAVING COUNT(NUM_DOC||'-'||NUM_IDENT_MENOR) > 1) T2 ON (T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR = T2.NUM_DOC_P) WHERE BAN_ESTADO_REG = 1 GROUP BY T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR UNION SELECT 0 AS TOTAL FROM DUAL ORDER BY TOTAL DESC) A WHERE ROWNUM = 1;
ELSE BANDERA := 0; END IF; END LOOP; END;

DECLARE
  CURSOR CUR_Beneficiario IS
      SELECT M.NUM_DOC||'-'||M.NUM_IDENT_MENOR IDT 
            ,A.SK_TIP_IDENT 
            ,A.NUM_DOC
            ,A.BAN_ESTADO_REG ESTADO_A
            ,M.SK_TIP_IDENT_M
            ,M.NUM_IDENT_MENOR
            ,M.BAN_ESTADO_REG ESTADO_M 
        FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> M
                JOIN <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?>  A
                  ON TRIM(M.NUM_IDENT_MENOR) = TRIM(A.NUM_DOC);
  v_Nro_Registros     PLS_INTEGER;
BEGIN
  v_Nro_Registros := 1;
  FOR Datos IN CUR_Beneficiario LOOP
    IF Datos.ESTADO_A !=1 OR Datos.ESTADO_M != 1 THEN
      UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?>
         SET  BAN_ESTADO_REG = 2                
       WHERE NUM_DOC||'-'||NUM_IDENT_MENOR = Datos.IDT
       AND BAN_ESTADO_REG <> 3
      ;
      v_Nro_Registros := v_Nro_Registros + 1;

      IF MOD (v_Nro_Registros, 5000) =  0 THEN
        COMMIT;
      END IF;
    END IF;
  END LOOP;
  COMMIT;
END;

DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_DUPLICADO IS(
            SELECT 
                 CASE 
                    WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR ELSE T1.NUM_DOC END AS NUM_DOC
                ,CASE 
                    WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_DOC ELSE T1.NUM_IDENT_MENOR END AS NUM_MENOR
            FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T1
            WHERE BAN_ESTADO_REG = 2)
            ;

    v_Reg_Duplicados            CUR_DUPLICADO%ROWTYPE;
    v_Nro_Duplicados            PLS_Integer; 

BEGIN

   OPEN CUR_DUPLICADO;
   v_Nro_Duplicados := 0;

  LOOP
    FETCH CUR_DUPLICADO INTO v_Reg_Duplicados;
    EXIT WHEN CUR_DUPLICADO%NOTFOUND;
    BEGIN  
        IF v_Reg_Duplicados.NUM_DOC IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TMP_TB") ?> T1
               SET BAN_ESTADO_CARGUE = 'E-'||'El Beneficiario '||v_Reg_Duplicados.NUM_DOC||' viene con el mismo documento en en acudiente'
             WHERE ''||NUM_DOC||'-'||NUM_DOC_MENOR||'' = ''||v_Reg_Duplicados.NUM_DOC||'-'||v_Reg_Duplicados.NUM_MENOR||'';
        END IF;
        COMMIT;

    END;
    END LOOP; 
  CLOSE  CUR_DUPLICADO;   

    DELETE FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T1
    WHERE BAN_ESTADO_REG = 2;

    COMMIT;

END;

