CURSOR CUR_DUPLICADO IS SELECT * FROM( SELECT T1.NUM_DOC ,T1.CO_ID ,T1.CUSTCODE ,T1.ICCID ,TO_CHAR(TO_DATE(T1.FEC_ENTREGA_SIM_CARD,'DD/MM/YYYY'),'DD/MM/YYYY')AS FEC_ENTREGA_SIM_CARD ,T1.CUSTOMER_ID ,T1.MIN ,T1.TMCODE ,BAN_ESTADO_CARGUE FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> T1 GROUP BY T1.NUM_DOC ,T1.CO_ID ,T1.CUSTCODE ,T1.ICCID ,TO_CHAR(TO_DATE(T1.FEC_ENTREGA_SIM_CARD,'DD/MM/YYYY'),'DD/MM/YYYY') ,T1.CUSTOMER_ID ,T1.MIN ,T1.TMCODE ,BAN_ESTADO_CARGUE ) B1 LEFT JOIN ( SELECT MIN AS MIN_LEFT ,NUM_DOC AS NUM_DOC_LEFT ,SK_ESTADO_BENEFI FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?>) B2 ON (B1.NUM_DOC = B2.NUM_DOC_LEFT) WHERE NVL(BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%' AND MIN_LEFT IS NOT NULL AND NVL(SK_ESTADO_BENEFI,-1) NOT IN (2);
v_Reg_Duplicados CUR_DUPLICADO%ROWTYPE; v_Nro_Duplicados PLS_Integer;
BEGIN
OPEN CUR_DUPLICADO; v_Nro_Duplicados := 0;
LOOP FETCH CUR_DUPLICADO INTO v_Reg_Duplicados; EXIT WHEN CUR_DUPLICADO%NOTFOUND; BEGIN IF v_Reg_Duplicados.NUM_DOC_LEFT IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||'El NUM_DOC '||v_Reg_Duplicados.NUM_DOC_LEFT||' se encuentra asociado al MIN '||v_Reg_Duplicados.MIN_LEFT WHERE A.MIN = v_Reg_Duplicados.min; END IF; END; END LOOP; CLOSE CUR_DUPLICADO;
END;

DECLARE
err_msg VARCHAR2(255);
CURSOR CUR_DUPLICADO IS SELECT * FROM( SELECT T1.NUM_DOC ,T1.CO_ID ,T1.CUSTCODE ,T1.ICCID ,TO_CHAR(TO_DATE(T1.FEC_ENTREGA_SIM_CARD,'DD/MM/YYYY'),'DD/MM/YYYY')AS FEC_ENTREGA_SIM_CARD ,T1.CUSTOMER_ID ,T1.MIN ,T1.TMCODE ,BAN_ESTADO_CARGUE FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> T1 GROUP BY T1.NUM_DOC ,T1.CO_ID ,T1.CUSTCODE ,T1.ICCID ,TO_CHAR(TO_DATE(T1.FEC_ENTREGA_SIM_CARD,'DD/MM/YYYY'),'DD/MM/YYYY') ,T1.CUSTOMER_ID ,T1.MIN ,T1.TMCODE ,BAN_ESTADO_CARGUE ) B1 LEFT JOIN ( SELECT ICCID AS ICCID_LEFT ,NUM_DOC AS NUM_DOC_LEFT ,MIN AS MIN_LEFT ,SK_ESTADO_BENEFI FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?>) B2 ON (B1.ICCID = B2.ICCID_LEFT) WHERE NVL(BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%' AND ICCID_LEFT IS NOT NULL AND NVL(SK_ESTADO_BENEFI,-1) NOT IN (2) ;
v_Reg_Duplicados CUR_DUPLICADO%ROWTYPE; v_Nro_Duplicados PLS_Integer;
BEGIN
OPEN CUR_DUPLICADO; v_Nro_Duplicados := 0;
LOOP FETCH CUR_DUPLICADO INTO v_Reg_Duplicados; EXIT WHEN CUR_DUPLICADO%NOTFOUND; BEGIN IF v_Reg_Duplicados.ICCID_LEFT IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||'El ICCID '||A.ICCID||' se encuentra asociado al numero de cedula '||v_Reg_Duplicados.NUM_DOC_LEFT||' con el min '||v_Reg_Duplicados.MIN_LEFT WHERE A.ICCID = v_Reg_Duplicados.ICCID; END IF; END; END LOOP; CLOSE CUR_DUPLICADO;
END;

DECLARE
err_msg VARCHAR2(255);
CURSOR CUR_BENEFICIARIO IS SELECT NUM_DOC ,CO_ID ,CUSTCODE ,ICCID ,ICCID_LEFT ,FEC_ENTREGA_SIM_CARD ,CUSTOMER_ID ,MIN ,TMCODE ,CAUSAL_ACTIVACION ,BAN_ESTADO_CARGUE ,NUM_DOC_LEFT ,MIN_LEFT ,SK_ESTADO_BENEFI ,CASE WHEN NVL(ICCID_LEFT,ICCID) = ICCID THEN 'SI' ELSE 'NO' END AS VALIDA FROM( SELECT NVL(T1.NUM_DOC,'-1') AS NUM_DOC ,NVL(T1.CO_ID,-1) AS CO_ID ,NVL(T1.CUSTCODE,-1) AS CUSTCODE ,NVL(T1.ICCID,-1) AS ICCID ,NVL(TO_CHAR(TO_DATE(T1.FEC_ENTREGA_SIM_CARD,'DD/MM/YYYY'),'DD/MM/YYYY'),'01/01/1900') AS FEC_ENTREGA_SIM_CARD ,NVL(T1.CUSTOMER_ID,-1) AS CUSTOMER_ID ,NVL(T1.MIN,-1) AS MIN ,NVL(T1.TMCODE,-1) AS TMCODE ,NVL(T1.CAUSAL_ACTIVACION,'N/A') AS CAUSAL_ACTIVACION ,BAN_ESTADO_CARGUE FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> T1 GROUP BY NVL(T1.NUM_DOC,'-1') ,NVL(T1.CO_ID,-1) ,NVL(T1.CUSTCODE,-1) ,NVL(T1.ICCID,-1) ,NVL(TO_CHAR(TO_DATE(T1.FEC_ENTREGA_SIM_CARD,'DD/MM/YYYY'),'DD/MM/YYYY'),'01/01/1900') ,NVL(T1.CUSTOMER_ID,-1) ,NVL(T1.MIN,-1) ,NVL(T1.TMCODE,-1) ,NVL(T1.CAUSAL_ACTIVACION,'N/A') ,BAN_ESTADO_CARGUE) B1 LEFT JOIN ( SELECT NUM_DOC AS NUM_DOC_LEFT ,MIN AS MIN_LEFT ,ICCID AS ICCID_LEFT ,SK_ESTADO_BENEFI FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?>) B2 ON (B1.NUM_DOC = B2.NUM_DOC_LEFT AND B1.MIN = B2.MIN_LEFT) WHERE NVL(BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%' AND NVL(B2.SK_ESTADO_BENEFI,-1) NOT IN (2);
v_Reg_Beneficiario CUR_BENEFICIARIO%ROWTYPE; v_Nro_Registros PLS_Integer;
BEGIN
OPEN CUR_BENEFICIARIO; v_Nro_Registros := 0;
LOOP FETCH CUR_BENEFICIARIO INTO v_Reg_Beneficiario; EXIT WHEN CUR_BENEFICIARIO%NOTFOUND;
BEGIN IF v_Reg_Beneficiario.VALIDA = 'NO' THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?> SET ICCID = v_Reg_Beneficiario.ICCID ,TMCODE = v_Reg_Beneficiario.TMCODE ,CAUSAL_ACTIVACION = v_Reg_Beneficiario.CAUSAL_ACTIVACION WHERE NUM_DOC = v_Reg_Beneficiario.NUM_DOC AND MIN = v_Reg_Beneficiario.MIN AND NVL(SK_ESTADO_BENEFI,-1) NOT IN (1,11,10);
UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-Se actualiza el ICCID '||v_Reg_Beneficiario.ICCID_LEFT||' por el ICCID '||A.ICCID||' para el MIN '||v_Reg_Beneficiario.MIN||' asociado al documento '||v_Reg_Beneficiario.NUM_DOC||'' WHERE A.NUM_DOC = v_Reg_Beneficiario.NUM_DOC AND A.MIN = v_Reg_Beneficiario.MIN;
ELSE
INSERT INTO <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?> (SK_ESTADO_BENEFI ,NUM_DOC ,CO_ID ,CUSTCODE ,ICCID ,CUSTOMER_ID ,MIN ,TMCODE ,FEC_ENTREGA_SIM_CARD ,FECHA_ESTADO ,CAUSAL_ACTIVACION ,CAUSAL_DESACTIVACION ,DIAS_SUSPENSION ,FEC_OPER_INI ,FEC_OPER_FIN ,ICCID_BSCS) VALUES ( 5 ,v_Reg_Beneficiario.NUM_DOC ,v_Reg_Beneficiario.CO_ID ,v_Reg_Beneficiario.CUSTCODE ,v_Reg_Beneficiario.ICCID ,v_Reg_Beneficiario.CUSTOMER_ID ,v_Reg_Beneficiario.MIN ,v_Reg_Beneficiario.TMCODE ,v_Reg_Beneficiario.FEC_ENTREGA_SIM_CARD ,SYSDATE ,v_Reg_Beneficiario.CAUSAL_ACTIVACION ,'N/A' ,0 ,'01/01/1900' ,'01/01/1900' ,-1);
UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'C' WHERE A.NUM_DOC = v_Reg_Beneficiario.NUM_DOC AND A.MIN = v_Reg_Beneficiario.MIN; END IF;
v_Nro_Registros := v_Nro_Registros + 1;
IF MOD (v_Nro_Registros, 5000) = 0 THEN COMMIT; END IF;
EXCEPTION WHEN OTHERS THEN err_msg := SQLERRM; UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||err_msg WHERE A.NUM_DOC = v_Reg_Beneficiario.NUM_DOC;
END; END LOOP; COMMIT; CLOSE CUR_BENEFICIARIO;
END;

BEGIN
INSERT INTO MINTIC_INFO_PLAN_ENTREGA_TB_PR
SELECT * FROM MINTIC_INFO_PLAN_ENTREGA_TB;
COMMIT;
END;

DECLARE

    err_msg    VARCHAR2(255);

  CURSOR CUR_DUPLICADO IS(
      SELECT
        MIN
    FROM <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?>
    GROUP BY MIN
    HAVING COUNT(MIN) > 1 );

    v_Reg_Duplicados            CUR_DUPLICADO%ROWTYPE;
    v_Nro_Duplicados            PLS_Integer; 

BEGIN

   OPEN CUR_DUPLICADO;
   v_Nro_Duplicados := 0;

  LOOP
    FETCH CUR_DUPLICADO INTO v_Reg_Duplicados;
    EXIT WHEN CUR_DUPLICADO%NOTFOUND;
    BEGIN  
        IF v_Reg_Duplicados.min IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> A
               SET BAN_ESTADO_CARGUE = 'E-'||'El mismo MIN '||A.MIN||' viene asociado a este documento '||A.NUM_DOC
             WHERE A.MIN = v_Reg_Duplicados.min;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_DUPLICADO;   

END;

