DECLARE
err_msg VARCHAR2(255);
CURSOR CUR_DUPLICADO IS SELECT * FROM(SELECT T1.SK_CATEG_BENEF ,T1.SK_TIP_IDENT ,T1.SK_MUNICIPIO ,T1.SK_ETAPA ,T1.SK_TECNOLOGIA ,CAST(REGEXP_REPLACE(T1.MIN, '[^0-9]+', '') AS NUMBER)AS MIN ,T1.NUM_DOC ,T1.FEC_ENTREGA_SIMCARD ,T1.FEC_PLANEADA ,T1.FEC_ENTREGA_ETAPA ,T1.NOM_COD_AGENTE ,T1.CODIGO_AGENTE ,T1.NUM_DOC_VENDEDOR ,T1.USU_RED_VENDEDOR ,T1.BAN_ESTADO_CARGUE FROM (SELECT T2.SK_CATEG_BENEF ,CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.SK_TIP_IDENT_M ELSE T2.SK_TIP_IDENT END AS SK_TIP_IDENT ,CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.SK_MUNICIPIO_M ELSE T2.SK_MUNICIPIO END AS SK_MUNICIPIO ,T4.SK_ETAPA ,T2.SK_TECNOLOGIA ,T1.MIN ,T1.NUM_DOC ,T1.FEC_REAL_ENTREGA FEC_ENTREGA_SIMCARD ,T1.FEC_PLANEADA FEC_PLANEADA ,T1.FEC_MAX_ENTREGA FEC_ENTREGA_ETAPA ,T1.NOMBRE_AGENTE NOM_COD_AGENTE ,T1.CODIGO_AGENTE CODIGO_AGENTE ,T1.NUM_DOC_VENDEDOR NUM_DOC_VENDEDOR ,T1.USUARIO_RED_VENDEDOR USU_RED_VENDEDOR ,BAN_ESTADO_CARGUE FROM <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> T1 LEFT JOIN <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T2 ON T1.NUM_DOC = (CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END) LEFT JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?> T3 ON (T1.NUM_DOC = T3.NUM_DOC AND (CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END) = T3.NUM_DOC) LEFT JOIN <?=odiRef.getObjectName("MINTIC_ESTADO_ETAPA_DIM_TB_T1") ?> T4 ON (T2.SK_MUNICIPIO = T4.SK_MUNICIPIO AND T3.TMCODE = T4.TMCODE AND T1.ETAPA = T4.ETAPA) WHERE T2.BAN_ESTADO_REG = 1)T1 GROUP BY T1.SK_CATEG_BENEF ,T1.SK_TIP_IDENT ,T1.SK_MUNICIPIO ,T1.SK_ETAPA ,T1.SK_TECNOLOGIA ,T1.MIN ,T1.NUM_DOC ,T1.FEC_ENTREGA_SIMCARD ,T1.FEC_PLANEADA ,T1.FEC_ENTREGA_ETAPA ,T1.NOM_COD_AGENTE ,T1.CODIGO_AGENTE ,T1.NUM_DOC_VENDEDOR ,T1.USU_RED_VENDEDOR ,T1.BAN_ESTADO_CARGUE) PE1 LEFT JOIN (SELECT MIN AS MIN_LEFT ,NUM_DOC NUM_DOC_LEFT FROM <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB_PR") ?>) PE2 ON (PE1.NUM_DOC = PE2.NUM_DOC_LEFT) WHERE NVL(BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%' AND MIN_LEFT IS NOT NULL;
v_Reg_Duplicados CUR_DUPLICADO%ROWTYPE; v_Nro_Duplicados PLS_Integer;
BEGIN
OPEN CUR_DUPLICADO; v_Nro_Duplicados := 0;
LOOP FETCH CUR_DUPLICADO INTO v_Reg_Duplicados; EXIT WHEN CUR_DUPLICADO%NOTFOUND; BEGIN IF v_Reg_Duplicados.MIN_LEFT IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||'El numero de documento '||A.NUM_DOC||' se encuentra asociado al MIn '||v_Reg_Duplicados.MIN_LEFT WHERE A.MIN = v_Reg_Duplicados.min; END IF; END; END LOOP; CLOSE CUR_DUPLICADO;
END;

DECLARE

    err_msg    VARCHAR2(255);

  CURSOR CUR_DUPLICADO IS
    SELECT
         CASE
            WHEN T1.CODIGO_AGENTE = T2.CODIGO_AGENTE THEN T2.CODIGO_AGENTE
            ELSE T1.CODIGO_AGENTE END AS NUEVO_AGENTE
        ,CASE
            WHEN T1.CODIGO_AGENTE = T2.CODIGO_AGENTE THEN 'IGUAL'
            ELSE 'DIFERENTE' END AS ESTADO_AGENTE
        ,T2.MIN 
        ,T2.CODIGO_AGENTE
        ,T1.BAN_ESTADO_CARGUE
    FROM <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> T1
    JOIN <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB_PR") ?> T2
    ON (T1.MIN = T2.MIN 
    AND T1.NUM_DOC = T2.NUM_DOC)
    RIGHT JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?> T3
    ON (T1.MIN = T3.MIN)
    WHERE NVL(BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%'
    AND T1.CODIGO_AGENTE IS NOT NULL
    AND SK_ESTADO_BENEFI NOT IN (1,3,10);


    v_Reg_Duplicados            CUR_DUPLICADO%ROWTYPE;
    v_Nro_Duplicados            PLS_Integer; 

BEGIN

   OPEN CUR_DUPLICADO;
   v_Nro_Duplicados := 0;

  LOOP
    FETCH CUR_DUPLICADO INTO v_Reg_Duplicados;
    EXIT WHEN CUR_DUPLICADO%NOTFOUND;
    BEGIN  
        IF v_Reg_Duplicados.ESTADO_AGENTE = 'DIFERENTE' THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> A
               SET BAN_ESTADO_CARGUE = 'E-'||'Para el MIN '||A.MIN||' se actualiza el codigo agente  '||v_Reg_Duplicados.CODIGO_AGENTE|| ' por el codigo agente ' ||v_Reg_Duplicados.NUEVO_AGENTE
             WHERE A.MIN = v_Reg_Duplicados.min;

             UPDATE <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB_PR") ?> A
             SET A.CODIGO_AGENTE = v_Reg_Duplicados.NUEVO_AGENTE
             WHERE A.MIN = v_Reg_Duplicados.min;

             UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?> A 
             SET SK_ESTADO_BENEFI = 11
             WHERE A.MIN = v_Reg_Duplicados.min
             AND SK_ESTADO_BENEFI NOT IN (1,3,10);

             /*UPDATE <?=odiRef.getObjectName("MINTIC_ACTIVACIONES_TB") ?> A
             SET A.CODIGO_DISTRIBUIDOR = v_Reg_Duplicados.NUEVO_AGENTE
             WHERE A.CODMIN = v_Reg_Duplicados.min;*/

        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_DUPLICADO;   
END;

DECLARE

    err_msg    VARCHAR2(255);

  CURSOR CUR_DUPLICADO IS(
    SELECT
        *
    FROM (
      SELECT
        CASE
            WHEN LENGTH(MIN) = 10 THEN 'BIEN'
            ELSE 'MAL' END ESTADO
        ,MIN
      FROM <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?>) 
      WHERE ESTADO = 'MAL' );

    v_Reg_Duplicados            CUR_DUPLICADO%ROWTYPE;
    v_Nro_Duplicados            PLS_Integer; 

BEGIN

   OPEN CUR_DUPLICADO;
   v_Nro_Duplicados := 0;

  LOOP
    FETCH CUR_DUPLICADO INTO v_Reg_Duplicados;
    EXIT WHEN CUR_DUPLICADO%NOTFOUND;
    BEGIN  
        IF v_Reg_Duplicados.min IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> A
               SET BAN_ESTADO_CARGUE = 'E-'||'El MIN '||A.MIN||' viene con mas de 10 digitos o con menos de 10 digitos '
             WHERE A.MIN = v_Reg_Duplicados.min;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_DUPLICADO;   

END;

DECLARE

    err_msg    VARCHAR2(255);

  CURSOR CUR_DUPLICADO IS
SELECT 
    CASE
        WHEN T3.MIN = T1.MIN THEN 'IGUAL' ELSE 'MAL' END AS VALIDA
    ,T3.MIN AS MIN_BENE
    ,T1.MIN AS MIN_TMP
    ,T4.MIN AS MIN_PLAN
    ,CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END AS NUM_DOC_MILLA
    ,T1.NUM_DOC AS NUM_DOC_TEMP
    ,T3.NUM_DOC AS NUM_DOC_BENE
    ,T4.NUM_DOC AS NUM_DOC_PLAN
    ,T1.BAN_ESTADO_CARGUE
FROM <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> T1
LEFT JOIN  <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T2
ON (T1.NUM_DOC = (CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END))
LEFT JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?> T3
ON (T1.NUM_DOC = T3.NUM_DOC
AND (CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END) =T3.NUM_DOC)
LEFT JOIN <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB_PR") ?> T4
ON (T2.MIN = T4.MIN AND T1.MIN = T4.MIN)
WHERE T2.BAN_ESTADO_REG = 3
AND T4.MIN IS NULL
AND NVL(T1.BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%';


    v_Reg_Duplicados            CUR_DUPLICADO%ROWTYPE;
    v_Nro_Duplicados            PLS_Integer; 

BEGIN

   OPEN CUR_DUPLICADO;
   v_Nro_Duplicados := 0;

  LOOP
    FETCH CUR_DUPLICADO INTO v_Reg_Duplicados;
    EXIT WHEN CUR_DUPLICADO%NOTFOUND;
    BEGIN  
        IF v_Reg_Duplicados.VALIDA = 'IGUAL' THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T2
                SET BAN_ESTADO_REG = 1
                ,SK_ETAPA = -1
            WHERE CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END = v_Reg_Duplicados.NUM_DOC_MILLA;
        ELSE
            UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> A
               SET BAN_ESTADO_CARGUE = 'E-'||'El MIN '||v_Reg_Duplicados.MIN_TMP||' no es igual al min cargado en Duplas, el MIn cargado en duplas es '||v_Reg_Duplicados.MIN_BENE
             WHERE A.MIN = v_Reg_Duplicados.MIN_TMP;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_DUPLICADO;   

END;

DECLARE
err_msg VARCHAR2(255);
CURSOR CUR_PLAN_ENTREGA IS SELECT * FROM(SELECT NVL(T1.SK_CATEG_BENEF,-1) AS SK_CATEG_BENEF ,NVL(T1.SK_TIP_IDENT,-1) AS SK_TIP_IDENT ,NVL(T1.SK_MUNICIPIO,-1) AS SK_MUNICIPIO ,NVL(T1.SK_ETAPA,-1) AS SK_ETAPA ,NVL(T1.SK_TECNOLOGIA,-1) AS SK_TECNOLOGIA ,NVL(CAST(REGEXP_REPLACE(T1.MIN, '[^0-9]+', '') AS NUMBER),-1) AS MIN ,NVL(T1.NUM_DOC,'0') AS NUM_DOC ,NVL(T1.FEC_ENTREGA_SIMCARD,'01/01/1900') AS FEC_ENTREGA_SIMCARD ,NVL(T1.FEC_PLANEADA,'01/01/1900') AS FEC_PLANEADA ,NVL(T1.FEC_ENTREGA_ETAPA,'01/01/1900') AS FEC_ENTREGA_ETAPA ,NVL(T1.NOM_COD_AGENTE,'N/A') AS NOM_COD_AGENTE ,NVL(T1.CODIGO_AGENTE,'N/A') AS CODIGO_AGENTE ,NVL(T1.NUM_DOC_VENDEDOR,0) AS NUM_DOC_VENDEDOR ,NVL(T1.USU_RED_VENDEDOR,'N/A') AS USU_RED_VENDEDOR ,BAN_ESTADO_CARGUE FROM (SELECT T2.SK_CATEG_BENEF ,CASE WHEN T2.sk_Categ_benef = 1 THEN T2.SK_TIP_IDENT_M ELSE T2.SK_TIP_IDENT END AS SK_TIP_IDENT ,CASE WHEN T2.sk_Categ_benef = 1 THEN T2.SK_MUNICIPIO_M ELSE T2.SK_MUNICIPIO END AS SK_MUNICIPIO ,T4.SK_ETAPA ,T2.SK_TECNOLOGIA ,T1.MIN ,T1.NUM_DOC ,T1.FEC_REAL_ENTREGA FEC_ENTREGA_SIMCARD ,T1.FEC_PLANEADA FEC_PLANEADA ,T1.FEC_MAX_ENTREGA FEC_ENTREGA_ETAPA ,T1.NOMBRE_AGENTE NOM_COD_AGENTE ,T1.CODIGO_AGENTE CODIGO_AGENTE ,T1.NUM_DOC_VENDEDOR NUM_DOC_VENDEDOR ,T1.USUARIO_RED_VENDEDOR USU_RED_VENDEDOR ,T1.BAN_ESTADO_CARGUE FROM <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> T1 LEFT JOIN <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB_PR") ?> T2 ON (T1.NUM_DOC = (CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END)) LEFT JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_PR") ?> T3 ON (T1.NUM_DOC = T3.NUM_DOC AND (CASE WHEN T2.SK_CATEG_BENEF = 1 THEN T2.NUM_IDENT_MENOR ELSE T2.NUM_DOC END) = T3.NUM_DOC) LEFT JOIN <?=odiRef.getObjectName("MINTIC_ESTADO_ETAPA_DIM_TB_T1") ?> T4 ON (T2.SK_MUNICIPIO = T4.SK_MUNICIPIO AND T3.TMCODE=T4.TMCODE AND T1.ETAPA = T4.TMCODE) WHERE T2.BAN_ESTADO_REG = 1)T1 GROUP BY NVL(T1.SK_CATEG_BENEF,-1) ,NVL(T1.SK_TIP_IDENT,-1) ,NVL(T1.SK_MUNICIPIO,-1) ,NVL(T1.SK_ETAPA,-1) ,NVL(T1.SK_TECNOLOGIA,-1) ,NVL(CAST(REGEXP_REPLACE(T1.MIN, '[^0-9]+', '') AS NUMBER),-1) ,NVL(T1.NUM_DOC,'0') ,NVL(T1.FEC_ENTREGA_SIMCARD,'01/01/1900') ,NVL(T1.FEC_PLANEADA,'01/01/1900') ,NVL(T1.FEC_ENTREGA_ETAPA,'01/01/1900') ,NVL(T1.NOM_COD_AGENTE,'N/A') ,NVL(T1.CODIGO_AGENTE,'N/A') ,NVL(T1.NUM_DOC_VENDEDOR,0) ,NVL(T1.USU_RED_VENDEDOR,'N/A') ,BAN_ESTADO_CARGUE) PE1 LEFT JOIN (SELECT NUM_DOC AS NUM_DOC_LEFT FROM <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB_PR") ?>) PE2 ON (PE1.NUM_DOC = PE2.NUM_DOC_LEFT) WHERE NVL(BAN_ESTADO_CARGUE,'0') NOT LIKE '%E%';
v_Reg_Plan_Entrega CUR_PLAN_ENTREGA%ROWTYPE; v_Nro_Registros PLS_Integer;
BEGIN OPEN CUR_PLAN_ENTREGA; v_Nro_Registros := 0;
LOOP FETCH CUR_PLAN_ENTREGA INTO v_Reg_Plan_Entrega; EXIT WHEN CUR_PLAN_ENTREGA%NOTFOUND;
BEGIN IF v_Reg_Plan_Entrega.NUM_DOC_LEFT IS NOT NULL THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB_PR") ?> SET NOM_COD_AGENTE=v_Reg_Plan_Entrega.NOM_COD_AGENTE ,CODIGO_AGENTE=v_Reg_Plan_Entrega.CODIGO_AGENTE ,NUM_DOC_VENDEDOR=v_Reg_Plan_Entrega.NUM_DOC_VENDEDOR ,USU_RED_VENDEDOR=v_Reg_Plan_Entrega.USU_RED_VENDEDOR ,MIN = v_Reg_Plan_Entrega.MIN WHERE NUM_DOC = v_Reg_Plan_Entrega.NUM_DOC;
UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> SET BAN_ESTADO_CARGUE = 'M' WHERE NUM_DOC = v_Reg_Plan_Entrega.NUM_DOC; ELSE
INSERT INTO <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB_PR") ?> ( SK_CATEG_BENEF ,SK_TIP_IDENT ,SK_MUNICIPIO ,SK_ETAPA ,SK_TECNOLOGIA ,MIN ,NUM_DOC ,FEC_ENTREGA_SIMCARD ,FEC_PLANEADA ,FEC_ENTREGA_ETAPA ,NOM_COD_AGENTE ,CODIGO_AGENTE ,NUM_DOC_VENDEDOR ,USU_RED_VENDEDOR) VALUES (v_Reg_Plan_Entrega.SK_CATEG_BENEF ,v_Reg_Plan_Entrega.SK_TIP_IDENT ,v_Reg_Plan_Entrega.SK_MUNICIPIO ,v_Reg_Plan_Entrega.SK_ETAPA ,v_Reg_Plan_Entrega.SK_TECNOLOGIA ,v_Reg_Plan_Entrega.MIN ,v_Reg_Plan_Entrega.NUM_DOC ,v_Reg_Plan_Entrega.FEC_ENTREGA_SIMCARD ,v_Reg_Plan_Entrega.FEC_PLANEADA ,v_Reg_Plan_Entrega.FEC_ENTREGA_ETAPA ,v_Reg_Plan_Entrega.NOM_COD_AGENTE ,v_Reg_Plan_Entrega.CODIGO_AGENTE ,v_Reg_Plan_Entrega.NUM_DOC_VENDEDOR ,v_Reg_Plan_Entrega.USU_RED_VENDEDOR) ; UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'C' WHERE A.NUM_DOC = v_Reg_Plan_Entrega.NUM_DOC; END IF;
v_Nro_Registros := v_Nro_Registros + 1;
IF MOD (v_Nro_Registros, 5000) = 0 THEN COMMIT; END IF;
EXCEPTION WHEN OTHERS THEN err_msg := SQLERRM; UPDATE <?=odiRef.getObjectName("MINTIC_INF_PLAN_ENTREGA_TMP_TB") ?> A SET BAN_ESTADO_CARGUE = 'E-'||err_msg WHERE A.NUM_DOC = v_Reg_Plan_Entrega.NUM_DOC;
END; END LOOP; COMMIT; CLOSE CUR_PLAN_ENTREGA;
END;
